import React from "react";
import Form from "antd";

const LoginForm = () => {
    return (
        <Form>
            <div>
                <label hmtlFor="user-id">아이디</label>
                <br />
                <input type="text" name="user-id" />
            </div>
        </Form>
    );
};

export default LoginForm;
